import './App.css';

function App() {
    return (
        <div className="App">
            <header className='Header'>
                <img className='Logo' src="/fuckyou/1.jpg" alt="Logo" />
            </header>
            <div className='Grid'>
                <div className='Image'>
                    <img src='/fuckyou/2.jpg' />
                    <img src='/fuckyou/3.jpg' />
                    <img src='/fuckyou/4.jpg' />
                    <img src='/fuckyou/5.jpg' />
                </div>
            </div>
        </div>
    );
}

export default App;
